import pytest
from app import app
from tests.tokens import get_token_not_admin



def get_token():
    data = {
        'email' : 'mike@mike.com',
        'password':'facu1234'
    }
    response = app.test_client().post('/api/v1/login', json=data)
    
    return response.json['access_token']

def get_token_refresh():
    data = {
        'email' : 'mike@mike.com',
        'password':'facu1234'
    }
    response = app.test_client().post('/api/v1/login', json=data)
    
    return response.json['refresh_token']
    
def test_insert_face_no_fields():
    data = {
        'parterId':'facu1234',
        'name':'facu1234'
    }
    response = app.test_client().post('/api/v1/face', json=data)
    
    assert response.status_code == 401


def test_insert_face_unauthorized():
    headers = {
        'Authorization': 'Bearer {}'.format(get_token_not_admin())
    }


    data = {
        "imageEncoded":"data:image/png;base64,",
        "partnerId":"888",
        "name":"maik"
    
    }
    
    response = app.test_client().post('/api/v1/face', json=data, headers=headers)
    
    assert response.json == "Inserted successfully."   
    assert response.status_code == 200


def test_insert_face():
    headers = {
        'Authorization': 'Bearer {}'.format(get_token())
    }

    data = {
        "partnerId" : "888"
    }
    response = app.test_client().get('/api/v1/partner', json=data, headers=headers)
    id = response.json["data"]["id"]



    data = {
        "imageEncoded": "data:image/png;base64,",
        "partnerId":id,
        "name":"maik"
    
    }
    
    response = app.test_client().post('/api/v1/face', json=data, headers=headers)
    
    assert response.json == "Inserted successfully."   
    assert response.status_code == 200


def test_put_face():
    headers = {
        'Authorization': 'Bearer {}'.format(get_token())
    }

    data = {
        "imageEncoded":"data:image/png;base64,",
    }
    
    response = app.test_client().put('/api/v1/face', json=data, headers=headers)

    partnerId = response.json["fkId"]
    dataPartner = {
        "partnerId": str(partnerId)
    }

    responsePartner = app.test_client().get('/api/v1/partner', json=dataPartner, headers=headers)

    namePartner = responsePartner.json["data"]["name"]
    nameResponse = response.json["name"]
    assert  nameResponse == namePartner
    assert response.status_code == 200